import React, { useEffect, useState } from "react";
import { Line } from "react-chartjs-2";
import { useNavigate } from "react-router-dom";
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

function DashboardPage() {
  const [history, setHistory] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const saved = JSON.parse(localStorage.getItem("predictionHistory")) || [];
    setHistory(saved);
  }, []);

  if (history.length === 0) {
    return (
      <div style={styles.empty}>
        <h2>No data yet üìâ</h2>
        <p>Go to the prediction form and generate some results first!</p>
      </div>
    );
  }

  // Compute top metrics
  const avgRainfall = (history.reduce((sum, item) => sum + item.Rainfall, 0) / history.length).toFixed(1);
  const avgTemp = (history.reduce((sum, item) => sum + item.Avg_Temperature, 0) / history.length).toFixed(1);
  const mostCommonCrop = Object.entries(
    history.reduce((acc, item) => {
      acc[item.Crop] = (acc[item.Crop] || 0) + 1;
      return acc;
    }, {})
  ).sort((a, b) => b[1] - a[1])[0][0];

  // Chart data (Yield over time)
  const labels = history.map((item) => `${item.Crop} (${item.Year})`);
  const yields = history.map((item) => item.predicted_yield);

  const chartData = {
    labels,
    datasets: [
      {
        label: "Predicted Yield (tons/ha)",
        data: yields,
        fill: true,
        backgroundColor: "rgba(76, 175, 80, 0.1)",
        borderColor: "#4CAF50",
        borderWidth: 3,
        tension: 0.4,
        pointBackgroundColor: "#2E7D32",
        pointBorderColor: "#fff",
        pointRadius: 6,
        pointHoverRadius: 8,
      },
    ],
  };

  const chartOptions = {
    plugins: {
      legend: {
        display: true,
        labels: {
          boxWidth: 15,
          color: "#2E7D32",
        },
      },
      tooltip: {
        enabled: true,
        backgroundColor: "#4CAF50",
        titleColor: "#fff",
        bodyColor: "#fff",
        bodyFont: { weight: "bold" },
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        ticks: { color: "#333", font: { size: 14 } },
        grid: { color: "rgba(76,175,76,0.1)" },
      },
      x: {
        ticks: { color: "#333", font: { size: 14 } },
        grid: { color: "rgba(76,175,76,0.1)" },
      },
    },
  };

  return (
    <div style={styles.page}>
      <div style={styles.container}>
        <h2 style={styles.heading}>üìä Yield Dashboard</h2>

        {/* Top Metric Cards */}
        <div style={styles.metricsContainer}>
          <div style={styles.metricCard}>
            <span style={styles.metricIcon}>üåæ</span>
            <div>
              <h4 style={styles.metricTitle}>Common Crop</h4>
              <p style={styles.metricValue}>{mostCommonCrop}</p>
            </div>
          </div>
          <div style={styles.metricCard}>
            <span style={styles.metricIcon}>üåßÔ∏è</span>
            <div>
              <h4 style={styles.metricTitle}>Avg Rainfall</h4>
              <p style={styles.metricValue}>{avgRainfall} mm</p>
            </div>
          </div>
          <div style={styles.metricCard}>
            <span style={styles.metricIcon}>üå°Ô∏è</span>
            <div>
              <h4 style={styles.metricTitle}>Avg Temperature</h4>
              <p style={styles.metricValue}>{avgTemp} ¬∞C</p>
            </div>
          </div>
        </div>

        {/* Chart Section */}
        <div style={styles.chartCard}>
          <h3 style={styles.chartTitle}>Crop Health Over Time</h3>
          <Line data={chartData} options={chartOptions} />
        </div>

        {/* Buttons */}
        <div style={styles.buttonContainer}>
          <button onClick={() => navigate("/schemes")} style={styles.btn}>
            üåø Government Schemes
          </button>
          <button onClick={() => navigate("/profit-loss")} style={styles.btn}>
            üíπ Profit‚ÄìLoss Analysis
          </button>
        </div>
      </div>
    </div>
  );
}

// Styles
const styles = {
  page: {
    minHeight: "100vh",
    background: "linear-gradient(180deg, #E8F5E9 0%, #ffffff 100%)",
    padding: "40px 20px",
    fontFamily: "'Poppins', sans-serif",
  },
  container: {
    maxWidth: "1000px",
    margin: "0 auto",
    background: "rgba(255, 255, 255, 0.9)",
    borderRadius: "20px",
    padding: "40px",
    boxShadow: "0 12px 30px rgba(0,0,0,0.1)",
    backdropFilter: "blur(8px)",
  },
  heading: {
    textAlign: "center",
    color: "#2E7D32",
    fontSize: "32px",
    marginBottom: "40px",
    fontWeight: "700",
  },
  metricsContainer: {
    display: "flex",
    justifyContent: "space-between",
    gap: "20px",
    flexWrap: "wrap",
    marginBottom: "40px",
  },
  metricCard: {
    flex: "1",
    minWidth: "220px",
    display: "flex",
    alignItems: "center",
    background: "#E8F5E9",
    borderRadius: "12px",
    padding: "20px",
    boxShadow: "0 4px 10px rgba(92, 185, 92, 0.15)",
    transition: "transform 0.2s ease-in-out, box-shadow 0.2s ease-in-out",
    cursor: "pointer",
  },
  metricCardHover: {
    transform: "translateY(-3px)",
    boxShadow: "0 4px 10px rgba(92, 185, 92, 0.25)",
  },
  metricIcon: {
    fontSize: "40px",
    marginRight: "15px",
  },
  metricTitle: {
    fontSize: "16px",
    color: "#333",
    fontWeight: "600",
    marginBottom: "6px",
  },
  metricValue: {
    fontSize: "22px",
    fontWeight: "700",
    color: "#2E7D32",
  },
  chartCard: {
    padding: "25px",
    background: "#fff",
    borderRadius: "16px",
    boxShadow: "0 6px 25px rgba(0,0,0,0.08)",
    marginBottom: "30px",
  },
  chartTitle: {
    fontSize: "20px",
    fontWeight: "700",
    color: "#2E7D32",
    marginBottom: "20px",
    textAlign: "center",
  },
  buttonContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "20px",
    flexWrap: "wrap",
  },
  btn: {
    background: "linear-gradient(90deg, #66BB6A, #81C784)",
    color: "white",
    border: "none",
    padding: "14px 28px",
    borderRadius: "14px",
    cursor: "pointer",
    fontSize: "16px",
    fontWeight: "600",
    transition: "all 0.3s ease",
  },
  empty: {
    textAlign: "center",
    marginTop: "80px",
    color: "#388E3C",
    fontSize: "18px",
  },
};

export default DashboardPage;
